def draw_fire_bullet(surface, b_obj):
    # Get movement data for rotation
    vx = b_obj.get('vx', 0)
    vy = b_obj.get('vy', 0)
    
    # Calculate angle based on velocity so it "faces" where it's flying
    angle = math.degrees(math.atan2(-vy, vx))
    
    # Create the visual surface (slightly larger than rect to allow for rotation)
    temp_surf = pygame.Surface((40, 40), pygame.SRCALPHA)
    
    # Draw the fire ball shape
    pygame.draw.ellipse(temp_surf, (255, 60, 0), (5, 10, 30, 20))    # Outer orange
    pygame.draw.ellipse(temp_surf, (255, 255, 255), (12, 12, 16, 16)) # White core
    
    # Rotate the image
    rotated_fire = pygame.transform.rotate(temp_surf, angle)
    
    # Blit it to the screen using the b_obj's rect center
    surface.blit(rotated_fire, rotated_fire.get_rect(center=b_obj["rect"].center))


