def handleInputs(x, y):
    """Handle player movement with arrow keys or WASD"""
    keys = pygame.key.get_pressed()
    move_amt = 5
    if slowerSpeed:
        move_amt = max(3, move_amt // 4)

    if keys[pygame.K_w] or keys[pygame.K_UP]:
        y -= move_amt
        print("W or UP key is currently pressed")
    if keys[pygame.K_s] or keys[pygame.K_DOWN]:
        y += move_amt
        print("S or DOWN key is currently pressed")
    if keys[pygame.K_a] or keys[pygame.K_LEFT]:
        x -= move_amt
        print("A or LEFT key is currently pressed")
    if keys[pygame.K_d] or keys[pygame.K_RIGHT]:
        x += move_amt
        print("D or RIGHT key is currently pressed")

    # Clamp position to border bounds so the player can't escape
    pw = player_image.get_width()
    ph = player_image.get_height()
    min_x = border_rect.left +1
    max_x = border_rect.right - pw -1
    min_y = border_rect.top + 1
    max_y = border_rect.bottom - ph -1
    
    x = max(min_x, min(x, max_x))
    y = max(min_y, min(y, max_y))
    
    return x, y
