def dropRectangle():
    # Iterate over a COPY of the list using [:] 
    # This prevents the loop from skipping items when one is removed
    for b_obj in left_right_bullets[:]:
        
        # --- TYPE 1: SHURIKENS ---
        if b_obj.get("type") == "shuriken":
            b_obj["real_x"] += b_obj["vx"]
            b_obj["real_y"] += b_obj["vy"]
            b_obj["rect"].x = int(b_obj["real_x"])
            b_obj["rect"].y = int(b_obj["real_y"])
            
            # Remove if off-screen
            if b_obj["rect"].top > screenHeight or b_obj["rect"].bottom < 0 or \
               b_obj["rect"].left > screenWidth or b_obj["rect"].right < 0:
                left_right_bullets.remove(b_obj)
                continue # Move to the next bullet immediately

        # --- TYPE 2: FIREBALLS ---
        elif b_obj.get("type") == "fireball":
            # Ensure movement variables exist
            b_obj["real_x"] = b_obj.get("real_x", float(b_obj["rect"].x))
            b_obj["real_y"] = b_obj.get("real_y", float(b_obj["rect"].y))
            
            
            if "vx" not in b_obj: b_obj["vx"] = 4
            if "vy" not in b_obj: b_obj["vy"] = b_obj.get("speed", 5) # Default to 5 if speed is missing

            b_obj["real_x"] += b_obj["vx"]
            b_obj["real_y"] += b_obj["vy"]
            b_obj["rect"].x = int(b_obj["real_x"])
            b_obj["rect"].y = int(b_obj["real_y"])

            # --- BOUNCE LOGIC ---
            # Vertical Bounce
            if b_obj["rect"].bottom >= (BORDER_TOP + BORDER_HEIGHT):
                b_obj["vy"] = -abs(b_obj["vy"])
                b_obj["rect"].bottom = BORDER_TOP + BORDER_HEIGHT
            elif b_obj["rect"].top <= BORDER_TOP:
                b_obj["vy"] = abs(b_obj["vy"])
                b_obj["rect"].top = BORDER_TOP

            # Horizontal Bounce
            if b_obj["rect"].right >= BORDER_LEFT + BORDER_WIDTH:
                b_obj["vx"] = -abs(b_obj["vx"])
                b_obj["rect"].right = BORDER_LEFT + BORDER_WIDTH
            elif b_obj["rect"].left <= BORDER_LEFT:
                b_obj["vx"] = abs(b_obj["vx"])
                b_obj["rect"].left = BORDER_LEFT
            
            # Sync the floats with the rect positions
            b_obj["real_x"] = float(b_obj["rect"].x)
            b_obj["real_y"] = float(b_obj["rect"].y)

